import React from "react";

export default () => {
  return (
    <div>
      <h3 className="display-4">About Contact Manager</h3>
      <p className="lead">Simple app to help you keep up with your contacts</p>
      <p className="text-secondary">Best Version on the market</p>
    </div>
  );
};
